body:
@yuslepukhin, may you try this:
build.bat --config Debug --build_shared_lib --parallel --enable_training --build_wheel --skip_tests

I cannot repo the issue with above build command.

@liqunfu At the commit I shared, the following command fails:

`./build.bat --config Debug --build_shared_lib --parallel --enable_training --build_wheel --skip_tests`

while:

`./build.bat --config Debug --build_shared_lib --parallel --enable_training --build_wheel --skip_tests --cmake_extra_defines CMAKE_CXX_FLAGS="/bigobj"`

succeeds.
